// Create a new component called Center
export const Center = styled.div`
    /* This is all CSS */
    display: flex;
    justify-content: center;
`;


export const StyledComponents = () => {
    return (
        <Center>
             <div id="box" style={{backgroundColor: 'blue', height: '50px', width: '50px'}}></div>
        </Center>
    );
}
